snippet.description:
Słuchaj w cyfrze: https://mugo.lnk.to/pamietnikskazanca

Ciemna Strefa prezentuje „PAMIĘTNIK SKAZAŃCA” czyli najnowszy singiel Bonusa RPK, promujący album "Głos Ulicy" . Za bit odpowiadają Czaha i Wowo, a całość skreczami urozmaicił DJ Gondek.
Teledysk wykonała ekipa 9LiterFilmy. 

